script: |
  super -f text -I q2675.spq | sort > q2675.out

inputs:
  - name: q2675.spq
    data: |
      SELECT col0 + + col0 * col1 FROM tab0 (FORMAT parquet) WHERE - col2 NOT BETWEEN + col2 * - - ( 17 ) AND ( + col1 );
  - name: tab0

outputs:
  - name: q2675.out
    data: |
      1230
      1914
      194
